    "import mpl_toolkits.mplot3d\n",
    "from sklearn import datasets\n",
    "from sklearn.decomposition import PCA\n",
    "import matplotlib.pyplot as plt\n",
    "\n",
    "# load iris dataset\n",
    "iris = datasets.load_iris()\n",
    "X = iris.data[:, 2:4]  # we only take the petal features.\n",
    "y = iris.target\n",
    "class_labels = iris.target_names\n",
    "\n",
    "# set plot limits\n",
    "x_min, x_max = X[:, 0].min() - 0.5, X[:, 0].max() + 0.5\n",
    "y_min, y_max = X[:, 1].min() - 0.5, X[:, 1].max() + 0.5\n",
    "\n",
    "# 2D scatter plot\n",
    "plt.figure(2, figsize=(8, 6))\n",
    "plt.clf()\n",
    "\n",
    "# set plot points\n",
    "scatter = plt.scatter(X[:, 0], X[:, 1], c=y, cmap=plt.cm.Set1, edgecolor=\"k\")\n",
    "plt.xlabel(\"Petal length\")\n",
    "plt.ylabel(\"Petal width\")\n",
    "plt.xlim(x_min, x_max)\n",
    "plt.ylim(y_min, y_max)\n",
    "\n",
    "# adding x and y tick marks\n",
    "plt.xticks(np.arange(np.floor(x_min), np.ceil(x_max) + 1, 1.0))\n",
    "plt.yticks(np.arange(np.floor(y_min), np.ceil(y_max) + 1, 0.5))\n",
    "\n",
    "\n",
    "# add legend\n",
    "handles, _ = scatter.legend_elements()\n",
    "legend_labels = [class_labels[i] for i in range(len(class_labels))]\n",
    "plt.legend(handles, legend_labels, title=\"Species\")\n",
    "\n",
    "plt.savefig(\"Petal_scatter_plot.png\")\n"
